var DistritoPath = new Array;

function GraficarDistrito(CP_Path){
 polygon = map.drawPolygon({
  paths: CP_Path, 
  strokeColor: '#92B7CC',		//define el color del perimetro del poligono
  strokeOpacity: 1,				//su opacidad
  strokeWeight: 3,				//y su grosor
  fillColor: '#BBD8E9',
  fillOpacity: 0.6
});
}

function changeDistrito(){
	var combo = document.getElementById('Distrito');	
		if(combo.selectedIndex<0)
   			 alert('No hay opción seleccionada');
		else{
			//Si es distinto de la primera opcion
			if(combo.options[combo.selectedIndex].value!=0){
			DistritoPath = selectedPath(combo.options[combo.selectedIndex].value);
		
			
			url = "files/"+ combo.options[combo.selectedIndex].value+".xml";
			CargarPapeleras(url);
			MostrarOnlyPapeleras(DistritoPath[0])
			GraficarDistrito(DistritoPath);
			}
		}
	}

